(function() {

    var timeId = setInterval(() => {
        if(!isEmpty(document.getElementsByTagName("video")[0])){
            document.getElementsByTagName("video")[0].currentTime = 120;
            window.clearInterval(timeId);
        }
    }, 500);

  function isEmpty(obj){
    if(obj==null || obj=="" || obj=='undefined' || obj==undefined||obj=='null'){
      return true;
    }else{
      return false;
    }
  }

})();